"use strict";

const fs = require("fs");
const path = require("path");

const TEST_JSON_FILE = "/app/yupana/bucket/test.json";

// call using URL: https://devloop.loopsoftware.fr/YPND/user/*/invoicing/largejson/largejson
exports.REST = {
    largejson: (_args, _content, _serv, _role, _session) => {
        try {
            const filePath = path.posix.resolve(TEST_JSON_FILE);

            let json;

            if(fs.existsSync(filePath)){
                const jsonAsString = fs.readFileSync(filePath);
                json = JSON.parse(jsonAsString);
            } else {
                json = DEFAULT_TEST_JSON;
            }

            return Promise.resolve({data: json});
        } catch (error) {
            return Promise.reject(error);
        }
    }
};

